import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

export default function ContactPage(){

return(
// dark mode form with first name, last name, email, message fields and a blue submit button

<Container>
    <Paper
      component="form"
      sx={{
        p: '2px 4px',
        display: 'flex',
        flexDirection: 'column',
        gap: 1,
        alignItems: 'center',
        width: 900,
        backgroundColor: '#1a1a1a',
        color: '#ffffff',
    
      }}
      elevation={0}
    >
      <TextField
        sx={{ m: 1, width: '25opx' }}
        id="outlined-basic"
        label="First Name"
        variant="outlined"
        color="primary"
        
      />
      <TextField
        sx={{ m: 1, width: '25ch' }}
        id="outlined-basic"
        label="Last Name"
        variant="outlined"
        color="primary"
      />
      <TextField
        sx={{ m: 1, width: '25ch' }}
        id="outlined-basic"
        label="Email"
        variant='filled'
        color="primary"
      />
      <TextField
        sx={{ m: 1, width: '50ch' }}
        id="outlined-basic"
        label="Message"
        variant="filled"
        color="primary"
        fullWidth
      />
      <Button
        sx={{ m: 1, width: '25ch' }}
        variant="contained"
        color="primary"
      >
        Submit
      </Button>
    </Paper>
</Container>

);
}
